import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import { Outlet } from "react-router-dom";

import Card from "./Components/Card";
import { ContextProvider } from "./Components/utils/global.context";


function App() {


  return (

      <div className="App">
        <ContextProvider> 
          <Navbar/>
          </ContextProvider>
          <Card/>
          <Footer/>
          <Outlet/>
      </div>
      
  );
}

export default App;
